import React, { useEffect, useState } from 'react';
import { Box, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button } from '@mui/material';

const API_KEY = 'FFTZ06W4JZ6C7ZDS'; // Replace with your Alpha Vantage API key

const TopRanked= () => {
  const [stocks, setStocks] = useState([]);

  useEffect(() => {
    const fetchStockData = async () => {
      try {
        const symbols = ['AAPL', 'GOOGL', 'MSFT']; // Add more symbols as needed
        const stockData = await Promise.all(
          symbols.map(async (symbol) => {
            const response = await fetch(`https://www.alphavantage.co/query?function=TIME_SERIES_DAILY&symbol=${symbol}&apikey=${API_KEY}`);
            const data = await response.json();
            const timeSeries = data['Time Series (Daily)'];
            const latestDate = Object.keys(timeSeries)[0];
            const latestData = timeSeries[latestDate];
            return {
              symbol,
              price: latestData['4. close'],
              change: (latestData['4. close'] - latestData['1. open']).toFixed(2),
              aiScore: Math.floor(Math.random() * 100), // Placeholder for AI score
            };
          })
        );
        setStocks(stockData);
      } catch (error) {
        console.error('Error fetching stock data:', error);
      }
    };

    fetchStockData();
  }, []);

  return (
    <Box>
      <TableContainer component={Paper}>
        <Table aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>Company</TableCell>
              <TableCell>Price</TableCell>
              <TableCell>Change</TableCell>
              <TableCell>AI Score</TableCell>
              <TableCell>AI Analysis</TableCell>
              <TableCell>Add to Portfolio</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {stocks.map((stock) => (
              <TableRow key={stock.symbol}>
                <TableCell>{stock.symbol}</TableCell>
                <TableCell>{stock.price}</TableCell>
                <TableCell>{stock.change}</TableCell>
                <TableCell>{stock.aiScore}</TableCell>
                <TableCell>
                  <Button variant="contained" color="primary">Generate</Button>
                </TableCell>
                <TableCell>
                  <Button variant="contained" color="secondary">Add to Portfolio</Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default TopRanked;
